<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Rockets</title>
    <link rel="stylesheet" href="Rocket.css">
</head>
<body>
    <div id="container">

        <mi-top id="topbar"></mi-top>

        <mi-right id="rightbar" class="no"></mi-right>

        <mi-left id="leftbar" class="no"></mi-left>

        <mi-center id="centerbar"></mi-center>

        <mi-supcenter id="supcenter"></mi-supcenter>

        <mi-rightcenter id="rightcenterbar"></mi-rightcenter>

        <mi-leftcenter id="leftcenterbar"></mi-leftcenter>

    </div>

    <div id="downbar">
        
        <div id="iconrocket">
            <img src="../storage/img/icons/rocket.svg" alt="">
            <span>Rockets</span>
        </div>
        
        <div id="iconcapsule">
            <img src="../storage/img/icons/capsule.svg" alt="">
            <span>Capsules</span>
        </div>
        
        <div id="iconhistory">
            <img src="../storage/img/icons/history.svg" alt="">
            <span>History</span>
        </div>
        
        <div id="iconcompany">
            <img src="../storage/img/icons/company.svg" alt="">
            <span>Company</span>
        </div>
        
    </div>

    <div id="buttons">
        <button id="uno">1</button>
        <button id="dos">2</button>
        <button id="tres">3</button>
        <button id="cuatro">4</button>
    </div>

</body>
<script src="./Rocket.js"></script>
</html>
